import './tailwind.css';
import './style.css'

import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import Menu from './Menu';
function App() {
  return (
    <>
    <Router>
      <Switch>
        <Route path="/order">
          <Order></Order>
        </Route>
        <Route path="">
          <Menu/>
        </Route>
      </Switch>
    </Router>
    </>
  );
}

export default App;
